() => {
  const datos = getVehicles.data?.records || [];
  const tipoSeleccionado = SelectFilterTipo.selectedOptionValue;
  const marcaSeleccionada = SelectFilterMarca.selectedOptionValue;
  console.log("Tipo:", tipoSeleccionado);
  console.log("Marca:", marcaSeleccionada);
  console.log("Datos originales:", datos);
  const filtrados = datos.filter(rec => (!tipoSeleccionado || rec.fields.tipo === tipoSeleccionado) && (!marcaSeleccionada || rec.fields.marca === marcaSeleccionada));
  console.log("Filtrados:", filtrados);
  storeValue("vehiculosFiltrados", filtrados);
}

